import Question from '../Components/Question';
import { SUBMIT_PAGE_PATH } from '../store';


function QuestionsExam()
{
    const questions = [1, 2, 3, 4, 5]; // use hook

    const questionsContent = questions.map((question) => 
    {
        return <div>{question}. ...</div>
    })

    return <div className="centerForm">
        <div className="centerScreen"> 
            <h3>Questions:</h3>
            {questionsContent}
            <Link to={SUBMIT_PAGE_PATH}>
                <button style={{fontSize : `16px`}}>SUBMIT</button>
            </Link>
        </div>
    </div>
}

export default QuestionsExam;
